if ('serviceWorker' in navigator) {
    navigator.serviceWorker.getRegistrations().then(registrations => {
        registrations.forEach(registration => {
            registration.unregister().then(success => {
                if (success) {
                    console.log('ServiceWorker unregistered successfully:', registration.scope);
                } else {
                    console.log('ServiceWorker unregister failed:', registration.scope);
                }
            });
        });
    }).catch(error => {
        console.log('Error getting ServiceWorker registrations:', error);
    });
}
if ('serviceWorker' in navigator) {
    const serviceWorker = navigator.serviceWorker.register
    navigator.serviceWorker.register = function (scriptURL, options) {
        return serviceWorker(scriptURL, options);
    }
}
